// app/services/csv-downloader.ts
import { inject as service } from '@ember/service';
import { A } from '@ember/array';
import { task, timeout } from 'ember-concurrency';
import { computed } from '@ember/object';
import { read } from 'ember-cli-htmlbars';
import { worker } from 'ember-cli-web-worker';

export default class CsvDownloaderService {
  @service('store') store;

  @task
  async downloadCSV() {
    const records = await this.store.findAll('model');
    const csvData = this.generateCSV(records);

    const blob = new Blob([csvData], { type: 'text/csv' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = 'data.csv';
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
  }

  @computed('{store.modelName}')
  get csvHeaders() {
    const modelName = this.get('store.modelName');
    const model = this.store.modelFor(modelName);
    const attributes = model.get('attributes');
    return A(Object.keys(attributes));
  }

  generateCSV(records) {
    const headers = this.csvHeaders.toArray();
    const rows = records.map((record) => {
      return headers.map((header) => {
        const attribute = record.get(header);
        return attribute ? attribute.toString() : '';
      });
    });

    const csv = [headers.join(','), ...rows.map((row) => row.join(',')).join('\n')];
    return csv.join('\r\n');
  }
}

