I'd recommend using a breadth-first traversal (BFT) to convert a tree to an array. Here's a simple example in Python:

```python
class Node:
    def __init__(self, x):
        self.val = x
        self.left = None
        self.right = None

def serialize(root):
    if not root:
        return []

    queue = [root]
    result = []

    while queue:
        node = queue.pop(0)
        result.append(node.val)

        if node.left:
            queue.append(node.left)
        if node.right:
            queue.append(node.right)

    return result

def deserialize(data):
    if not data:
        return None

    root = Node(data[0])
    queue = [root]
    index = 1

    while queue:
        node = queue.pop(0)

        if data[index] is not None:
            node.left = Node(data[index])
            queue.append(node.left)
        index += 1

        if index < len(data) and data[index] is not None:
            node.right = Node(data[index])
            queue.append(node.right)
        index += 1

    return root
```

In this example, the `serialize` function converts a tree to a list, and the `deserialize` function recreates the tree from the list.

