1. malloc:

```c
#include <stdio.h>
#include <stdlib.h>

void *my_malloc(size_t size) {
    void *ptr = malloc(size);
    if (ptr == NULL) {
        fprintf(stderr, "Memory allocation failed\n");
        exit(EXIT_FAILURE);
    }
    return ptr;
}
```

2. calloc:

```c
void *my_calloc(size_t nmemb, size_t size) {
    void *ptr = calloc(nmemb, size);
    if (ptr == NULL) {
        fprintf(stderr, "Memory allocation failed\n");
        exit(EXIT_FAILURE);
    }
    return ptr;
}
```

3. realloc:

```c
void *my_realloc(void *ptr, size_t size) {
    void *new_ptr = realloc(ptr, size);
    if (new_ptr == NULL) {
        fprintf(stderr, "Memory reallocation failed\n");
        exit(EXIT_FAILURE);
    }
    return new_ptr;
}
```

These functions are wrappers around the standard library functions `malloc`, `calloc`, and `realloc`. They check if the memory allocation was successful and exit the program if it fails. You can use these functions in your C programs to dynamically allocate memory.

